PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "organizations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar(255), "password_digest" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "courses" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "code" varchar(255), "description" varchar(255), "first_day" date, "last_day" date, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" integer);
CREATE TABLE "dashboards" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "conference_dates" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "date" date, "user_id" integer, "start_time" time, "end_time" time, "duration" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "reason" varchar(255));
CREATE TABLE "meetings" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "conference_date_id" integer, "start_time" time, "end_time" time, "meet_with" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE INDEX "index_conference_dates_on_user_id" ON "conference_dates" ("user_id");
CREATE INDEX "index_meetings_on_conference_date_id" ON "meetings" ("conference_date_id");
COMMIT;
